class Solution(object):
    def ladderLength(self, beginWord, endWord, wordList):
        """
        :type beginWord: str
        :type endWord: str
        :type wordList: List[str]
        :rtype: int
        """

        if endWord not in wordList:
            return 0

        wordList = set(wordList)
        wordList.add(endWord)

        # build graph
        graph = collections.defaultdict(list)
        for word in wordList:
            for i in range(len(word)):
                graph[word[:i]].append(word[i:])

        # build distance dict
        distance = {beginWord:1}
        visited = set()
        visited.add(beginWord)
        step = 2

        # BFS
        while endWord not in distance:
            new_distance = {}
            for word in distance:
                if word in graph:
                    for neighbor in graph[word]:
                        if neighbor not in visited:
                            visited.add(neighbor)
                            if neighbor not in new_distance:
                                new_distance[neighbor] = step
                            else:
                                new_distance[neighbor] = min(new_distance[neighbor], step)
            distance = new_distance
            step += 1

        if endWord not in distance:
            return 0
        else:
            return distance[endWord]

