class Solution(object):
    def searchRange(self, nums, target):
        """
        :type nums: List[int]
        :type target: int
        :rtype: List[int]
        """

        if not nums:
            return [-1, -1]

        left = self.binary_search(nums, target, True)
        right = self.binary_search(nums, target, False)

        return [left, right]

    def binary_search(self, nums, target, find_left_idx):
        low = 0
        high = len(nums) - 1

        idx = -1

        while low <= high:
            mid = (low + high) // 2

            if nums[mid] == target:
                idx = mid
                if find_left_idx:
                    high = mid - 1
                else:
                    low = mid + 1
            elif nums[mid] < target:
                low = mid + 1
            else:
                high = mid - 1

        return idx

