        """
        :type nums: List[int]
        :rtype: int
        """

        if len(nums) <= 1:
            return 0

        max_jump = nums[0]
        cur_jump = nums[0]
        jump_count = 1
        next_jump = 0

        for i in range(1, len(nums)):
            if i == len(nums) - 1:
                return jump_count

