    def calculate(self, s):
        """
        :type s: str
        :rtype: int
        """

        num, sign, total, num_next, sign_next = 0, 1, 0, 0, 1
        for c in s:
            if c in '+-':
                total += num * sign_next
                num, sign, num_next, sign_next = num_next, sign_next if c == '+' else -sign_next, 0, 1
            elif c == ' ':
                pass
            elif c == '(':
                num, sign, num_next, sign_next = num_next, sign_next, 0, 1
            elif c == ')':
                total += num * sign_next
                return total
            elif c.isdigit():
                num = num * 10 + int(c)
            else:
                raise ValueError('Invalid character: %s' % c)
        total += num * sign_next
        return total

