class Solution(object):
    def isValid(self, s):
        """
        :type s: str
        :rtype: bool
        """

        if len(s) % 2 != 0:
            return False

        if s[0] in [')',']','}']:
            return False

        pairs = {')':'(',']':'[','}':'{'}
        stack = [s[0]]

        for c in s[1:]:
            if c in pairs:
                if not stack or pairs[c] != stack.pop():
                    return False
            else:
                stack.append(c)

        if stack:
            return False

        return True

