    def containsNearbyDuplicate(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: bool
        """

        if len(nums) == len(set(nums)):
            return False

        if k >= len(nums):
            k = len(nums) - 1

        seen = {}

