class Solution(object):
    def minWindow(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """

        if len(t) > len(s):
            return ""

        # build hash table of t
        need = {}
        for c in t:
            if c not in need:
                need[c] = 1
            else:
                need[c] += 1

        # try to extend the range of the window
        valid = 0
        # check the initial window
        start, end = 0, 0
        # keep track of the valid characters
        window_valid = {}
        # keep track of the valid characters in the range
        window_valid_count = 0
        # try to extend the range of the window
        # as long as the window is within the range of s
        while end < len(s):
            # if the character doesn't exist in the hash table, skip
            if s[end] not in need:
                end += 1
                continue
            # if the character exists in the hash table, add it to the window
            if s[end] in window_valid:
                window_valid[s[end]] += 1
                if window_valid[s[end]] == need[s[end]]:
                    window_valid_count += 1
            else:
                window_valid[s[end]] = 1
                window_valid_count += 1
            # if the valid characters match the need, increment the valid count
            if window_valid_count == len(need):
                valid += 1
                # if the valid characters match the need, increment the valid count
                if valid == 1:
                    start = end
            # if the valid characters don't match the need, decrement the valid count
            elif window_valid_count < len(need):
                valid -= 1
            # if the valid characters don't match the need, decrement the valid count
            else:
                # if the character at the start of the window is in the hash table, decrement the count
                if window_valid[s[start]] == need[s[start]]:
                    window_valid_count -= 1
                    if window_valid[s[start]] == need[s[start]]:
                        valid -= 1
                window_valid[s[start]] -= 1
                if window_valid[s[start]] < need[s[start]]:
                    window_valid_count += 1
                start += 1
            end += 1

        # if the valid characters match the need, increment the valid count
        if valid == len(need):
            return s[start:end]
        else:
            return ""

