class Solution(object):
    def longestIncreasingPath(self, matrix):
        """
        :type matrix: List[List[int]]
        :rtype: int
        """

        if not matrix or not matrix[0]:
            return 0

        m, n = len(matrix), len(matrix[0])
        v = {}
        ans = 0

        def dfs(i, j):
            if (i, j) not in v:
                v[i, j] = vj if (vj := matrix[i][j]) is None else 1
                if i > 0 and vj < matrix[i - 1][j]:
                    if vj + 1 == matrix[i - 1][j]:
                        v[i, j] = v[i - 1, j] + 1
                    else:
                        v[i, j] = max(v[i, j], dfs(i - 1, j) + 1)
                if j > 0 and vj < matrix[i][j - 1]:
                    if vj + 1 == matrix[i][j - 1]:
                        v[i, j] = v[i, j - 1] + 1
                    else:
                        v[i, j] = max(v[i, j], dfs(i, j - 1) + 1)
                if i < m - 1 and vj < matrix[i + 1][j]:
                    if vj + 1 == matrix[i + 1][j]:
                        v[i, j] = v[i + 1, j] + 1
                    else:
                        v[i, j] = max(v[i, j], dfs(i + 1, j) + 1)
                if j < n - 1 and vj < matrix[i][j + 1]:
                    if vj + 1 == matrix[i][j + 1]:
                        v[i, j] = v[i, j + 1] + 1
                    else:
                        v[i, j] = max(v[i, j], dfs(i, j + 1) + 1)
                ans = max(ans, v[i, j])
            return v[i, j]

        for i in range(m):
            for j in range(n):
                ans = max(ans, dfs(i, j))

        return ans

