class Solution(object):
    def convertToBase7(self, num):
        """
        :type num: int
        :rtype: str
        """

        if num < 0:
            return '-' + self.convertToBase7(-num)

        if num < 7:
            return str(num)

        res = ''
        if num < 0:
            num = -num

        while num >= 7:
            res = str(num % 7) + res
            num //= 7

        return str(num) + res

